    Scientific Computer System (SCS) aboard NOAA Ship Ronald H. Brown in the Arctic
    Ocean and North Pacific Ocean from 2015-01-14 to 2015-02-13. Office of Marine and
    Aviation Operations (OMAO) personnel aboard the ship submitted these data and associated
    metadata to NODC. In addition, NODC Accession 0126056 contains supplementary cruise-level
    metadata, which OMAO personnel logged in the Ship Daily Activity Log (SDAL). OMAO
